import { Component, OnInit } from '@angular/core';
import { WebBackendService } from './services/web-backend.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  gamesSearches: any;
  constructor(private clientAPI: WebBackendService) {
    this.gamesSearches = [];
  }
  ngOnInit(): void {
    //this.clientAPI.runTest();
    this.clientAPI.searchName("gundam")
    .subscribe(value => {
      this.gamesSearches = Object.values(value);
      console.log(this.gamesSearches);
    });
  }
}
